import React, { useState, useEffect } from 'react';
import * as s from './splitStyle';

const Split = () => {
  const fixedMinPrice = 0; // 이 값을 실제 값으로 초기화해야 합니다.
  const fixedMaxPrice = 100; // 이 값을 실제 값으로 초기화해야 합니다.
  const priceGap = 10; // 이 값을 실제 값으로 초기화해야 합니다.

  const [rangeMinValue, setRangeMinValue] = useState(fixedMinPrice);
  const [rangeMaxValue, setRangeMaxValue] = useState(fixedMaxPrice);
  const [rangeMinPercent, setRangeMinPercent] = useState(0);
  const [rangeMaxPercent, setRangeMaxPercent] = useState(0);

  const prcieRangeMinValueHandler = (e) => {
    setRangeMinValue(parseInt(e.target.value));
  };

  const prcieRangeMaxValueHandler = (e) => {
    setRangeMaxValue(parseInt(e.target.value));
  };

  const twoRangeHandler = () => {
    if (rangeMaxValue - rangeMinValue < priceGap) {
      setRangeMaxValue(rangeMinValue + priceGap);
      setRangeMinValue(rangeMaxValue - priceGap);
    } else {
      setRangeMinPercent((rangeMinValue / fixedMaxPrice) * 100);
      setRangeMaxPercent(100 - (rangeMaxValue / fixedMaxPrice) * 100);
    }
  };

  useEffect(() => {
    twoRangeHandler();
  }, [rangeMinValue, rangeMaxValue]);

  return (
    <div style={{ padding: '50px' }}>
      <s.FilterTimeSlide>
        <s.FilterTimeSlideInner
          rangeMinPercent={rangeMinPercent}
          rangeMaxPercent={rangeMaxPercent}
        />
      </s.FilterTimeSlide>
      <s.FilterTimeRangeWrap>
        <s.FilterTimeRangeMin
          type="range"
          min={fixedMinPrice}
          max={fixedMaxPrice - priceGap}
          step="1000"
          value={rangeMinValue}
          onChange={(e) => prcieRangeMinValueHandler(e)}
        />
        <s.FilterTimeRangeMax
          type="range"
          min={fixedMinPrice + priceGap}
          max={fixedMaxPrice}
          step="1000"
          value={rangeMaxValue}
          onChange={(e) => prcieRangeMaxValueHandler(e)}
        />
      </s.FilterTimeRangeWrap>
    </div>
  );
};

export default Split;
